export default function SupportChars() {
    const supportChars = [
        'Ana',
        'Baptiste',
        'Brigitte',
        'Illari',
        'Kiriko',
        'Lifeweaver',
        'Lúcio',
        'Mercy',
        'Moira',
        'Zenyatta'
    ];

    return (
        <>
        <h3>Support Characters</h3>
        {supportChars.map((support, index) => (
            <label key={index}>{support}</label>
        ))}

        </>
    );
}
